    [],nt"revision_timestamp": "2016-05-25T00:42:33.227040",nt"name": "project-and-program-action-information-system-papai",nt"isopen":
    true,nt"url": null,nt"notes": "EDTS/PAPAI is a monitoring system that tracks
    NEPA project progress between major milestones, and helps accurately determine the
    total processing time from initiation of an Environmental Impact Statement (EIS)
    or Environmental Assessment (EA) to the approval of the final decision document,
    one component of the Every Day Counts Initiative. This information is used for regular
    reports to the Council on Environmental Quality (CEQ) as well as FHWA and US DOT
    leadership. EDTS is being upgraded to add project and action tracking, with the
    enhanced system being renamed PAPAI.?",nt"license_title": "Other License Specified",nt"extras":
